import React from 'react'

// DEBUGS[2025-04-18 21:45] 导入react/client
import ReactDOM from 'react-dom/client'

import App from './App'
/** 
 * ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
*/

const root = ReactDOM.createRoot(document.getElementById('root'))
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
)
